import React from 'react';

function ProductList({ products }) {
    return (
        <div>
            <h2>Product List</h2>
            <ul>
                {products.map((product, index) => (
                    <div key={product.id}>
                        <li style={{ listStyleType: 'none', marginBottom: '20px' }}>
                            <img src={product.image} alt={product.name} style={{ width: '150px', height: 'auto' }} />
                            <h3>{product.name}</h3>
                            <p>{product.description}</p>
                            <p>Brand: {product.brand}</p>
                            <p>Category: {product.category}</p>
                            <p>Price: â‚¹{product.price}</p>
                            <p style={{ color: product.stock > 0 ? 'green' : 'red' }}>
                                Stock Status: {product.stock > 0 ? `${product.stock} in stock` : 'Out of Stock'}
                            </p>
                            {product.video && (
                                <div>
                                    <h4>Product Video:</h4>
                                    <iframe
                                        width="300"
                                        height="200"
                                        src={product.video}
                                        title={product.name}
                                        frameBorder="0"
                                        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                                        allowFullScreen
                                    ></iframe>
                                </div>
                            )}
                        </li>
                        {index !== products.length - 1 && <hr />}  {/* Add line separator after each product except the last */}
                    </div>
                ))}
            </ul>
        </div>
    );
}

export default ProductList;
